import React from "react";
import { FormControl, TextField, Button } from "@material-ui/core";

import { FieldTitle } from "../../atoms";
import Icons from "../../../resources/icons";
import "./index.scss";

export const BookingServicesModal = ({
  goBack,
  goNext,
  close,
  values,
  onChange,
}) => {
  return (
    <div id="booking-services-detail-modal" className="box">
      <div className="service-modal-body">
        <div className="modal-title-container">
          <span className="modal-title">Detalle de producto</span>
          <svg
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            onClick={close}
          >
            <path
              d="M24 2.41714L21.5829 0L12 9.58286L2.41714 0L0 2.41714L9.58286 12L0 21.5829L2.41714 24L12 14.4171L21.5829 24L24 21.5829L14.4171 12L24 2.41714Z"
              fill="#9FABAE"
              onClick={close}
            />
          </svg>
        </div>
        <hr></hr>
        <FormControl className="field-container">
          <FieldTitle icon={Icons.messages} label="Message" />
          <TextField
            type="text"
            name="description"
            value={values.description}
            onChange={onChange}
            className="field-input"
            variant="outlined"
            margin="normal"
            multiline
            rows={4}
          />
        </FormControl>
      </div>
      <div className="modal-footer box">
        <Button variant="contained" color="primary" onClick={goBack}>
          Regresar
        </Button>
        <Button variant="contained" color="primary" onClick={goNext}>
          Siguiente
        </Button>
      </div>
    </div>
  );
};
